import React  from 'react';
import { useSelector } from 'react-redux';
import Recipe from '../Recipe/Recipe.js';
import * as S from './Recipes.styled.js';

export default function Recipes() {
  const recipes  = useSelector((state) => state.recipes.displayed);
  const page = useSelector((state) => state.parameters.page);

  return (
      <S.Recipes> 
        { 
          recipes?.slice(page*4, (page + 1)*9).map(recipe => {
            return ( 
              <Recipe 
                key= { recipe.id }
                id={ recipe.id }
                title={ recipe.title }
                image={ recipe.image }
                diets={ recipe.diets }
                score={ recipe.score }
              /> 
            )
          })
        }
      </S.Recipes> 
  )
};
